  const wrapperRef = useRef(null);
  useOutsideAlerter(wrapperRef, setPopupHidden);

  return (
    <div className="cell-menu-popup" ref={wrapperRef}>
      <div className="cell-menu-row">
        <p>Filter data</p>
      </div>
      <div className="cell-menu-row">
        <p>Change calculation</p>
      </div>
      <div className="cell-menu-row">
        <p>Delete</p>
      </div>
    </div>
  );
}

export default CellMenuPopup;
